import React, { useState } from "react";

export default function AdminML() {
  const [training, setTraining] = useState(false);
  const [lastRun, setLastRun] = useState(null);

  const startTraining = () => {
    setTraining(true);
    fetch("http://localhost:5000/api/ml/train", { method: "POST" })
      .then(res => res.json())
      .then(data => {
        setTraining(false);
        setLastRun(new Date().toLocaleString());
      })
      .catch(err => {
        console.error(err);
        setTraining(false);
      });
  };

  return (
    <div style={{ marginLeft: 220, padding: 20 }}>
      <h2>ML Module</h2>
      <button onClick={startTraining} disabled={training}>
        {training ? "Training..." : "Train Model"}
      </button>
      {lastRun && <p>Last trained: {lastRun}</p>}
    </div>
  );
}
